description:
Based very loosely on Robert Ludlum&amp;#039;s novel, the Bourne Identity is the story of a man whose wounded body is discovered by fisherman who nurse him back to health. He can remember nothing and begins to try to rebuild his memory based on clues such as the Swiss bank account, the number of which, is implanted in his hip. He soon realizes that he is being hunted and takes off with Marie on a search to find out who he is and why he is being hunted.
